Issue 5 - &quot;THE DROP&quot;
Death on the Helicarrier. The killer is at large. Hill leads the investigation.
Another incident on board. No-one expects a proper acid bath. Coulson goes rogue. Hawkeye wonders. Spider-Woman talks with a new friend.

